window.bookSummaryJSON = "<p>All John wanted to do was get away for his life in Kluane National Park for a weekend. Hike, camp, and chill. Instead, the world comes to an end in a series of blue boxes, animals start evolving, and monsters start spawning. Now, he has to survive the apocalypse, get back to civilization, and not lose his mind. <i>Life in the North</i> is book one of the System Apocalypse, a litRPG apocalypse series that combines modern day life, science fiction, and fantasy elements along with game mechanics.</p>"; 
